function App()  {

  return (
    <div className="App">
      <section className ="App-content">
      <h1>App</h1>

        <a href='/gif/programming'>gifs de hacker</a>
        <a href='/gif/deportes'>Gifs de deportes</a>
        <a href='/gif/panda'>Gifs de deportes</a>
       <Route path='/gif/:keyword'  component= {ListOfGifs}/> 

      </section>
    </div>
  );
}


export default App;
